import classes from "./Dialogs.module.css";
import {DialogItem} from "./DialogItem/DialogItem";
import {Message} from "./Message/Message";


export const Dialogs = (props: any) => {

    let dialogsData = [
        {id: 1, name: 'Alex'},
        {id: 2, name: 'Vasile'},
        {id: 3, name: 'Michael'},
        {id: 4, name: 'Any'},
        {id: 5, name: 'Anna'}
    ];

    let messagesData = [
        {id: 1, message: 'Hi Alex'},
        {id: 2, message: 'Hi Vasile'},
        {id: 3, message: 'Hello dear Michael'},
        {id: 4, message: 'hi my sister Any'},
        {id: 5, message: 'Yo, how are you Anna'}
    ]

    let dialogsElement = dialogsData.map(el => <DialogItem name={el.name} id={el.id}/>)
    let messagesElement = messagesData.map(el => <Message message={el.message} key={el.id}/>)

    return (
        <div className={classes.dialogs}>
            <div className={classes.dialogsItems}>
                {dialogsElement}
            </div>
            <div className={classes.messages}>
                {messagesElement}

            </div>
        </div>
    )
}
